        #region Operators
        public static bool operator ==(GB2260_2007String lhs, GB2260_2007String rhs)
        {
            if (lhs as Object == null && rhs as Object == null) return true;
            if (lhs as Object == null || rhs as Object == null) return false;
            return lhs.GetHashCode() == rhs.GetHashCode();

        }
        public static bool operator !=(GB2260_2007String lhs, GB2260_2007String rhs)
        {
