        /// <summary>
        /// 判断是否管辖区
        /// </summary>
        /// <param name="value">GB2260_2007String对象</param>
        /// <returns></returns>
        public Boolean IsGovern(GB2260_2007String value)
        {
            if (value == null)
                return false;
            if (value.ToString() == this.ToString())
                return false;
            if (this.County != "00")
                return false;
            if (value.ToString().Substring(0, 2) == this.Province)
            {
                if (this.City == "00" && this.Province != "71")
                {
                    if (this.City == value.ToString().Substring(2, 2))
                        return false;
                    else
                        return true;
                }
                else
                {
                    if (value.ToString().Substring(2, 2) == "00" && this.Province != "71")
                        return false;
                    else
                    {
                        if (this.City == value.ToString().Substring(2, 2))
                        {
                            if (value.ToString().Substring(4, 2) == "00")
                                return false;
                            else
                                return true;
                        }
                        else
                        {
                            return false;
                        }
                    }
                }
            }
            else
            {
                return false;
            }
        }
        /// <summary>
        /// 判断是否附属区
        /// </summary>
        /// <param name="value">GB2260_2007String对象</param>
        /// <returns></returns>
        public Boolean IsSubordinate(GB2260_2007String value)
        {
            if (value == null)
                return false;
            if (value.ToString() == this.ToString())
                return false;
            if (value.ToString().Substring(4, 2) != "00")
                return false;
            if (value.ToString().Substring(0, 2) == this.Province)
            {
                if (value.ToString().Substring(2, 2) == "00" && this.Province != "71")
                {
                    if (this.City == value.ToString().Substring(2, 2))
                        return false;
                    else
                        return true;
                }
                else
                {
                    if (this.City == "00" && this.Province != "71")
                        return false;
                    else
                    {
                        if (this.City == value.ToString().Substring(2, 2))
                        {
                            if (this.County == "00")
                                return false;
                            else
                                return true;
                        }
                        else
                        {
                            return false;
                        }
                    }
                }
            }
            else
            {
                return false;
            }

        }
