        /// <summary>
        /// 重写Equals
        /// </summary>
        /// <param name="obj"></param>
        /// <returns></returns>
        public override bool Equals(object obj)
        {
            if (obj == null) return false;
            return this.GetHashCode() == obj.GetHashCode();
        }
        /// <summary>
        /// 重写GetHashCode
        /// </summary>
        /// <returns></returns>
        public override int GetHashCode()
        {
            return this.ToString().GetHashCode();
        }
        /// <summary>
        /// 修改GB2260_2007String对象的内容
        /// </summary>
        /// <param name="FullName">国标县名或者GB/T 2260-2007国标编码</param>
        public void Change(string value)
        {
            try
            {
                int code;
                if (int.TryParse(value, out code))
                {
                    this.Source = DataSource.FromCode(value);
                    this.Code = this.Source.Code;
                }
                else
                {
                    this.Code = DataSource.ToCode(value);
                    this.Source= DataSource.FromName(value);
                }
            }
            catch
            {
                throw new NotImplementedException("错误的编码或者地区名");
            }
        }
